INSERT INTO `curso` (`id`, `capacitador_id`, `descripcion`, `contenido`, `modalidad`, `certificado_id`, `inscricion_abierta`) VALUES
(101, NULL, 'DESTINATARIOS: Personal de planta permanente con funciones sobre documentación y archivos.\r\nCIERRE DE INSCRIPCIÓN: 09 DE OCTUBRE\r\nINICIO: MARTES 13 OCTUBRE A LAS 16 a 19 HS', '<p><strong>INSCRIPCI&Oacute;N</strong>: Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.<br />La pre-inscripci&oacute;n y presentaci&oacute;n del formulario finaliza el 9 de OCTUBRE.</p><p><a href="../../uploads/publicacion/c346d64d87162f553befd68814a80d414d6e8f14.pdf">FICHA T&Eacute;CNICA</a></p><p><a href="../../uploads/publicacion/85561363719e811679e5bb01cfe8a72cff1b43d0.pdf">FORMULARIO DE INSCRIPCI&Oacute;N</a></p><p><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">PRE-INSCRIBIRSE:</a></p>', 'presencial', NULL, 1),
(102, NULL, 'DESTINATARIOS: Agentes de las distintas jurisdicciones del Estado Provincial cuyas funciones incluyan mantenimiento, diseño o aspectos de proyecto de sistemas de climatización o servicios mecánicos para edificios.\r\nINICIO: MARTES 06 DE OCTUBRE', '<p style="text-align: center;"><strong>IMPORTANTE</strong><br /><strong>INSCRIPCI&Oacute;N:</strong> Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.<br />La pre-inscripci&oacute;n y presentaci&oacute;n del formulario <strong>CONTIN&Uacute;A ABIERTA.</strong> (Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p style="text-align: left;"><a href="../../uploads/publicacion/85561363719e811679e5bb01cfe8a72cff1b43d0.pdf">FORMULARIO DE INSCRIPCI&Oacute;N</a></p><p style="text-align: left;"><a href="../../uploads/publicacion/a4c7277a2e8b770f641d407aa36e5d8e47024c15.pdf">FICHA T&Eacute;CNICA</a></p><p style="text-align: left;"><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">PRE-INSCRIBIRSE:</a></p>', 'presencial', NULL, 1),
(103, NULL, 'DESTINATARIOS: Directores, jefes, responsables de programas o proyectos de la Administración Central y de los Organismos descentralizados y autárquicos.\r\nINICIO: 01 de octubre de 16 a 19 hs.', '<p style="text-align: center;"><strong>IMPORTANTE</strong><br /><strong>INSCRIPCI&Oacute;N:</strong> Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.<br />L<strong>a pre-inscripci&oacute;n y presentaci&oacute;n del formulario finaliza el 30 de septiembre.</strong></p><p style="text-align: left;"><a href="../../uploads/publicacion/a6e0c27d930de64abc05532d0e30dfdae9b5fde7.pdf">FICHA T&Eacute;CNICA</a></p><p style="text-align: left;"><a href="../../uploads/publicacion/85561363719e811679e5bb01cfe8a72cff1b43d0.pdf">FORMULARIO DE INSCRIPCI&Oacute;N</a></p><p style="text-align: left;"><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">PRE-INSCRIBIRSE:</a></p>', 'presencial', NULL, 1),
(104, NULL, 'DESTINATARIOS: Agentes de las distintas jurisdicciones del Estado Provincial cuyas funciones requieran conocimiento de idioma inglés.\r\nINICIO: LUNES 5 DE OCTUBRE DE 7:30 a 10:30 HS', '<p style="text-align: center;"><strong>IMPORTANTE</strong><br /><strong>INSCRIPCI&Oacute;N</strong>: Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.<br /><strong>La pre-inscripci&oacute;n y presentaci&oacute;n del formulario finaliza el 1 de OCTUBRE.</strong></p><p style="text-align: left;"><a href="../../uploads/publicacion/85561363719e811679e5bb01cfe8a72cff1b43d0.pdf">FORMULARIO DE INSCRIPCI&Oacute;N</a></p><p style="text-align: left;"><a href="../../uploads/publicacion/6fcd1bd22aaf3ddff2871c050aa434666e1ff8b5.pdf">FICHA T&Eacute;CNICA</a></p><p style="text-align: left;"><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">PRE-INSCRIBIRSE:</a></p>', 'presencial', NULL, 1),
(105, NULL, 'Destinatarios: Empleados Públicos que estén en la actualidad en condiciones de acceder al beneficio jubilatorio  -o se encuentren en dicha condición en uno a dos años- cualquiera sea su categoría laboral y dedicación.', '<p style="text-align: center;"><strong>CHARLA&nbsp;INFORMATIVA SOBRE LOS BENEFICIOS SOCIALES JUBILATORIOS: </strong>La&nbsp;misma se llevar&aacute; a cabo el dia martes 24 de noviembre de 17:30 a 19:30hs</p><p><a href="../../../uploads/publicacion/6447924ab330e6e81ea6dee7e81c8a8ef637c934.pdf">FICHA T&Eacute;CNICA</a></p><p><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">PRE-INSCRIBIRSE AQUI</a></p><p>&nbsp;</p><p>&nbsp;</p>', 'presencial', NULL, 1),
(107, NULL, 'DESTINATARIOS:\r\n• Destinado especialmente a empleados del Estado Provincial, ingresados en los últimos años a la\r\nplanta Permanente de la Administración Pública, que deseen conocer cómo se organiza el Poder\r\nEjecutivo del Estado Provincial, y todo agente interesado en la temática.\r\nMODALIDAD: VIRTUAL\r\nINICIO: 26 DE OCTUBRE', '<p style="text-align: center;"><strong>ATENCI&Oacute;N</strong></p><p>Para participar los interesados deber&aacute;n pre-inscribirse a trav&eacute;s de la p&aacute;gina<strong> ipap.chaco.gov.ar.</strong> El correo que use para pre-inscribirse ser&aacute; utilizado para enviarle el usuario y contrase&ntilde;a para ingresar al curso en la plataforma virtual, por tal motivo, para los cursos de modalidad virtual, es indispensable que el participante disponga de una cuenta de correo electr&oacute;nico personal, v&aacute;lida y de uso frecuente. L<strong>a inscripci&oacute;n finaliza el 23 de octubre a las 13h</strong>s. (No se requerir&aacute; el formulario de inscripci&oacute;n impreso)</p><p>El curso se desarrollar&aacute; en la plataforma virtual de IPAP Chaco http://elearning.ipap.chaco.gov.ar/ <strong>desde el 26/10 hasta el 23/11 y culminar&aacute; con un examen presencial el 24/11 de 8 a 10hs</strong> en la sede de IPAP Chaco Arturo Illia 26.</p><p><a href="../../../uploads/publicacion/90c09ac3bdb9160abe6cb793040833553f6f4fa3.pdf">FICHA T&Eacute;CNICA</a></p><p><a href="../../../alumno/cursos/todos">PRE-INSCRIBIRSE</a></p>', 'elearning', NULL, 1),
(108, NULL, 'El objetivo general de la actividad es que los agentes incorporen las nociones fundamentales de Servicio de Excelencia y gestionar la atención personalizada. La misma estará a cargo del Lic. Sergio Geniadieff. Lunes 16 y miércoles 18 de noviembre de 8 a 11 hs.', '<p>Cronograma: lunes 16 y mi&eacute;rcoles 18 de noviembre&nbsp;de 8 a 11 hs.&nbsp;</p><p><a href="../../../uploads/publicacion/ec28f1512230904b210088f6cce44be668209de3.pdf">Ficha T&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Pre inscribirse aqu&iacute;</a></p>', 'presencial', NULL, 1),
(109, NULL, 'El objetivo general de la actividad es que los agentes incorporen las nociones fundamentales de Servicio de Excelencia y gestionar la atención personalizada. La misma estará a cargo del Lic. Sergio Geniadieff. Martes 17  y jueves 19 de noviembre de 16 a 19 hs.', '<p>Cronograma: Martes 17 y Jueves 19 de noviembre de 16 a 19</p><p><a href="../../../uploads/publicacion/a34d517d7962c1216e4d31cc927c9cdc7d377e6d.pdf">Ficha T&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Pre inscribirse aqu&iacute;</a></p>', 'presencial', NULL, 0),
(110, NULL, 'Son objetivos de la presente actividad que los agentes conozcan los principios de la comunicación eficaz y que adquieran las destrezas y habilidades para gestionar nuestra comunicación personal, grupal y organizacional. Estará a cargo del Lic. Sergio Geniadieff. Martes 17 y Jueves 19 de noviembre de 8 a 12 hs.', '<p>Cronograma: Martes 17 y Jueves 19 de noviembre de 8 a 12 hs.</p><p><a href="../../uploads/publicacion/0b8e0efe511230639b6afdfbe3461089d98c07cc.pdf" target="_blank">Ficha t&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Pre inscribirse aqu&iacute;</a></p>', 'presencial', NULL, 0),
