(116, NULL, 'El objetivo de la actividad formativa es sensibilizar y concientizar al personal sobre la importancia de su labor en la organización, prevención y conservación  de los documentos.', '<p><a href="../../../uploads/publicacion/1a25047b23add729186ee548da27241ab3b34e14.pdf" target="_blank">Ver ficha t&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></p>', 'presencial', NULL, 1),
