(118, NULL, 'Destinatarios: REPRESENTANTES DEL ÁREA DE PRENSA, DIFUSIÓN Y COMUNICACIÓN DE CADA JURISDICCIÓN DEL ESTADO PROVINCIAL O QUIENES REALICEN TAREAS SIMILARES.', '<p>Capacitadores: Lic.Paulo Buticce, Subsecretario de Comunicaci&oacute;n y Medios y el Sr. Facundo Gil de la Agencia Brandon.</p><p>Cronograma de encuentros:</p><p>Martes 05/04 de 16 a 18 hs.</p><p>Martes 19/04 de 16 a 18 hs.</p><p>Martes 03/05 de 16 a 18 hs.</p><p>Martes 17/05 de 16 a 18 hs.</p><p><a href="../../../uploads/publicacion/9b430ff462506fe7e2172b22d89e396cbd7788b2.pdf" target="_blank">Ver ficha t&eacute;cnica aqu&iacute;</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></p><p><a href="http://www.comunicacioninterna.chaco.gov.ar/">Enlace del material</a></p><p>&nbsp;</p>', 'presencial', NULL, 1),
(119, NULL, 'Estará a cargo de la Abg. Daniela Cantaluppi.', '<p>Destinatarios: A<span lang="ES-AR">gentes de la administraci&oacute;n p&uacute;blica con tareas sobre gesti&oacute;n de expedientes, confecci&oacute;n de proyectos de actos administrativos y asesor&iacute;a.</span></p><p><span lang="ES-AR"><strong>Fecha de inicio:</strong>&nbsp;Martes 26 de abril -&nbsp;</span><strong>Fecha de finalizaci&oacute;n</strong>: Martes 24 de mayo&nbsp;</p><p>D&iacute;as y Horarios: Martes y jueves de 17 a 19.30 hs.</p><p>CIERRE DE INSCRIPCI&Oacute;N:&nbsp;<strong><span lang="ES-AR">21 DE ABRIL A LAS 20 HS&nbsp;</span></strong><span lang="ES-AR">o una vez cubierto el cupo previsto para la actividad.</span></p><p>&nbsp;<a href="../../../uploads/publicacion/c94f7326aa73e9868d05b3fe4786dccccb44d926.pdf" target="_blank">Ver detalles del curso aqu&iacute;</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></p><div align="center"><strong><span lang="ES">IMPORTANTE</span></strong></div><div dir="ltr" align="center"><strong><span lang="ES">INSCRIPCI&Oacute;N</span></strong><span lang="ES">:&nbsp;</span>Para participar deber&aacute;&nbsp;<strong>pre-inscribirse</strong>&nbsp;en nuestra web&nbsp;<strong><a href="../../../" target="_blank">ipap.chaco.gov.ar</a></strong>&nbsp;y presentar&nbsp;<strong>a la brevedad</strong>&nbsp;el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso. La&nbsp;<strong>inscripci&oacute;n finaliza el 21 DE ABRIL A LAS 20 HS&nbsp;</strong>o <strong>una vez cubierto el cupo previsto</strong> para la actividad</div>', 'presencial', NULL, 1),
(120, NULL, 'Estará a cargo del Lic. Jorge Codutti.', '<p class="normal"><strong><span style="text-decoration: underline;"><span lang="ES-AR">DESTINATARIOS</span></span></strong><strong><span lang="ES-AR">: </span></strong><span lang="ES-AR">Personal con funciones administrativas sobre&nbsp; gesti&oacute;n de la documentaci&oacute;n y archivos.&nbsp;</span></p><p><span lang="ES-AR"><strong>Fecha de inicio:</strong>&nbsp;Lunes 16 de mayo-&nbsp;</span><strong>Fecha de finalizaci&oacute;n</strong>: Lunes 13&nbsp;de&nbsp;junio</p><p>D&iacute;as y Horarios: Lunes&nbsp;y mi&eacute;rcoles&nbsp;de 16 a 19 hs.</p><p>CIERRE DE INSCRIPCI&Oacute;N:&nbsp;<strong>12 DE MAYO</strong><strong><span lang="ES-AR">&nbsp;A LAS 13&nbsp;HS&nbsp;</span></strong><span lang="ES-AR">o <strong>una vez cubierto el cupo</strong> previsto para la actividad.</span></p><p><span lang="ES-AR"><a href="../../uploads/publicacion/a1feb2c4b6303800ce5b29a218b8633ae683df03.pdf" target="_blank">Ver detalles del curso aqu&iacute;</a></span></p><p><span lang="ES-AR"><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong><span lang="ES">IMPORTANTE</span></strong></p><div dir="ltr" align="center"><strong><span lang="ES">INSCRIPCI&Oacute;N</span></strong><span lang="ES">:&nbsp;</span>Para participar deber&aacute;&nbsp;<strong>pre-inscribirse</strong>&nbsp;en nuestra web&nbsp;<strong><a href="../../../" target="_blank">ipap.chaco.gov.ar</a></strong>&nbsp;y presentar&nbsp;<strong>a la brevedad</strong>&nbsp;