(121, NULL, 'DESTINATARIOS: agentes de mandos medios y superiores de la Dirección de Vialidad Urbana (Dirección de Vialidad Provincial)', '<p><strong>DURACI&Oacute;N: </strong>10 hs total, distribuidas en tres (3)&nbsp; encuentros, de cuatro (4) horas el primero y de tres (3) los restantes.</p><p>&nbsp;</p><p><strong>CRONOGRAMA:</strong></p><p>Encuentro 1: S&aacute;bado 09/04 <strong>Horario: 8 a 12 hs.</strong></p><p>Encuentro 2: S&aacute;bado 16/04 <strong>Horario: 9 a 12 hs.</strong></p><p>Encuentro 3: S&aacute;bado 23/04 <strong>Horario: 9 a 12 hs.</strong></p>', 'presencial', NULL, 1),
(122, NULL, 'Estará a cargo de la Profesora Angélica Alejandra Maidana.', '<p><strong>DESTINATARIOS</strong>: Personal asignado formalmente para los servicios de atenci&oacute;n al visitante extranjero durante toda la Bienal de Esculturas 2016, de las siguientes instituciones y organismos: Instituto de Turismo, Instituto de Cultura, Polic&iacute;a del Chaco, las &aacute;reas de Comunicaci&oacute;n y de Ceremonial y Protocolo del Gobierno de la Provincia y de la Municipalidad de la ciudad de Resistencia, Fundaci&oacute;n Urunday.&nbsp;</p><p><strong>Fecha de inicio</strong>: mi&eacute;rcoles 13 de abril - <strong>Fecha de finalizaci&oacute;n</strong>: 1&ordm; de julio</p><p>D&iacute;as y horarios: mi&eacute;rcoles y viernes de 14.30 a 17 hs.</p><p>CIERRE DE INSCRIPCI&Oacute;N: <strong>Viernes 8 de abril a las 20</strong>.</p><p><a href="../../uploads/publicacion/19e292e5e538ba4c932020409f295cd7767ffb43.pdf" target="_blank">Ver detalles del curso aqu&iacute;</a></p>', 'presencial', NULL, 1),
(123, NULL, 'Estará a cargo del Sr. Orlando Gadotti, Director de Ceremonial y Protocolo del Poder Ejecutivo de la Provincia.', '<p><strong>DESTINATARIOS</strong>: Personal asignado formalmente para los servicios de atenci&oacute;n al visitante extranjero durante toda la Bienal de Esculturas 2016, de las siguientes instituciones y organismos: Instituto de Turismo, Instituto de Cultura, Polic&iacute;a del Chaco, las &aacute;reas de Comunicaci&oacute;n y de Ceremonial y Protocolo del Gobierno de la Provincia y de la Municipalidad de la ciudad de Resistencia, Fundaci&oacute;n Urunday.&nbsp;</p><p><strong>Fecha de inicio</strong>: mi&eacute;rcoles 27&nbsp;de abril -&nbsp;<strong>Fecha de finalizaci&oacute;n</strong>: 8&nbsp;de junio</p><p>D&iacute;a y horario: mi&eacute;rcoles de 17 a&nbsp;18.30 hs.</p><p>CIERRE DE INSCRIPCI&Oacute;N:&nbsp;<strong>Viernes 8 de abril a las 20</strong>.</p><p><a href="../../../uploads/publicacion/19e292e5e538ba4c932020409f295cd7767ffb43.pdf" target="_blank">Ver detalles del curso aqu&iacute;</a></p>', 'presencial', NULL, 0),
(124, NULL, 'ACLARACIÓN: Este Taller está destinado EXCLUSIVAMENTE a los agentes de la administración pública provincial que decidan integrar equipos de investigación y presentar ideas proyecto en la convocatoria 2016 del IPAP.', '<h1 class="normal" style="text-align: center;"><strong><span lang="ES-AR"><a href="../../../seccion/convocatoriaproyectos" target="_blank">Ver detalles de la Convocatoria aqu&iacute;</a></span></strong></h1><p style="text-align: center;">&nbsp;<a href="../../../uploads/publicacion/3889916bf04f7cf63ec377874257770e26c924f8.pdf" target="_blank">Ver contenidos del Taller aqu&iacute;</a></p><p>&nbsp;</p>', 'presencial', NULL, 1),
(125, NULL, 'Estará a cargo de la Profesora Natalia Peres.', '<p><strong>DESTINATARIOS</strong>: Personal asignado formalmente para los servicios de atenci&oacute;n al visitante extranjero durante toda la Bienal de Esculturas 2016, de las siguientes instituciones y organismos: Instituto de Turismo, Instituto de Cultura, Polic&iacute;a del Chaco, las &aacute;reas de Comunicaci&oacute;n y de Ceremonial y Protocolo del Gobierno de la Provincia y de la Municipalidad de la ciudad de Resistencia, Fundaci&oacute;n Urunday.&nbsp;</p><p><strong>Fecha de inicio</strong>: mi&eacute;rcoles 13 de abril -&nbsp;<strong>Fecha de finalizaci&oacute;n</strong>:&nbsp;29 de junio</p><p>D&iacute;as y horarios: martes&nbsp;y mi&eacute;rcoles&nbsp;de 14.30 a 17 hs.</p><p>&nbsp;</p>', 'presencial', NULL, 1),
(126, NULL, 'A cargo de Prof. Hugo Roberto WINGEYER - Prof. Silvina ESPÍNDOLA - Prof. Vanina Evelyn ZARZA \r\nProf. Bárbara Belén BENITEZ.', '<p>DESTINATARIOS: Empleados del Estado Provincial con funciones administrativas ingresados en los &uacute;ltimos a&ntilde;os a la planta Permanente de la Administraci&oacute;n P&uacute;blica.</p><p><strong>Fecha de Inicio:</strong> Martes 17 de mayo. &nbsp;<strong>fecha de finalizaci&oacute;n:</strong> Martes 14 de junio&nbsp;</p><p><strong>D&iacute;as y horarios</strong>: martes y mi&eacute;rcoles de 08 hs a 11 hs</p><p><strong>Cierre de inscripci&oacute;n</strong> 13 de mayo a las 13 hs <strong>o&nbsp;una vez cubierto el cupo</strong>&nbsp;previsto para la actividad.</p><p><a href="../../uploads/publicacion/4a200ee152944d28d985d41b3528e33da0030df4.pdf">ver detalle del curso aqui</a></p><p><a href="http://www.ipap.chaco.gov.ar/alumno/cursos/todos">Inscripci&oacute;n aqui</a></p><p>&nbsp;</p><p style="text-align: center;"><strong>IMPORTANTE</strong><br />INSCRIPCI&Oacute;N: Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n de su jefe para asistir al curso.&nbsp;La pre-inscripci&oacute;n y presentaci&oacute;n del formulario finaliza el 13 DE MAYO A LAS 13hs o una vez cubierto el cupo.</p>', 'presencial', NULL, 1),
(127, NULL, 'Dictado: Sólo los días Jueves de 08 hs a 17 hs', '<h2><strong><span style="text-decoration: underline;"><em>ATENCI&Oacute;N nuevo d&iacute;a de inicio:</em></span><em> El curso comenzar&aacute; el jueves 2 de junio en el horario previsto. La inscripci&oacute;n cierra el viernes 27 de mayo a las 13.</em></strong></h2><p>&nbsp;</p><p><strong><em>DESTINATARIOS: Personal con funciones de t&eacute;cnico &ndash; administrativo de la Administraci&oacute;n P&uacute;blica Provincial y Municipios&nbsp; de la Provincia el Chaco INVITADOS&nbsp;por la Secretar&iacute;a de Municipios y Ciudades.</em></strong></p><p><a href="../../../uploads/publicacion/8b00c6efd34c94a565d538dfe5cd3e4cfbc4f0dc.pdf">Ver organismos Invitados</a></p><p>&nbsp;</p><p><strong>NOTA: </strong></p><p>- La <strong>inscripci&oacute;n&nbsp;se cierra&nbsp;una vez cubierto el cupo</strong>&nbsp;previsto para la actividad.</p><p>-&nbsp;La admisi&oacute;n de los pre-inscriptos ser&aacute; realizada por la Secretaria de Municipios y Ciudades y el IPAP CHACO, de acuerdo con la n&oacute;mina de personas designadas formalmente por el organismo convocado.&nbsp;</p><p>&nbsp;</p><p><a href="../../../uploads/publicacion/a6e0e6b32b1930eba178c77df93b2f06b872a023.pdf" target="_blank">Ver detalles del curso en ficha t&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></p><p>&nbsp;</p><p style="text-align: center;"><br />&nbsp;</p>', 'presencial', NULL, 0),
(129, NULL, 'FORMACIÓN DE DIRECTIVOS', '<p><span lang="EN-GB"><strong>Destinatarios:</strong> <br />- Directores Generales, Directores y jefes de las jurisdicciones de la Administraci&oacute;n Central y de los Organismos descentralizados y aut&aacute;rquicos.<br />- Responsable de equipos de proyectos y programas.<br />- Personal integrante de equipos formalizados para implementaci&oacute;n y gesti&oacute;n de calidad en la Administraci&oacute;n P&uacute;blica.</span></p><p><strong><span lang="EN-GB">Duraci&oacute;n:&nbsp;</span></strong><span lang="EN-GB">Carga horaria total: 20 horas, distribuidas en 3 clases presenciales de 4 horas cada una y 8 horas de trabajo en aula virtual.</span></p><p><strong><span lang="EN-GB">Clases presenciales:</span></strong><span lang="EN-GB"> Sede IPAP Chaco, Arturo Illia 26</span></p><ul><li><span lang="EN-GB">Lunes 30/5 16 a 20 hs.</span></li><li>Mi&eacute;rcoles 1/6 16 a 20 hs.</li><li>Lunes 6/6 16 a 20 hs</li></ul><p><strong>Clases virtuales: </strong>se desarrollar&aacute;n en &nbsp;<a href="http://elearning.ipap.chaco.gov.ar/">http://elearning.ipap.chaco.gov.ar/</a></p><p><a href="../../../uploads/publicacion/f95aeb015c6a77ef19d9977816e1ec4daa59f363.pdf">Ver detalles del curso en ficha t&eacute;cnica</a></p><p><a href="../../../alumno/cursos/todos">Pre-inscribirse aqu&iacute;</a></p>', 'presencial', NULL, 1),
(130, NULL, 'Será dictado por el Dr. Hugo Wingeyer.', '<p>Cronograma:</p><p>Jueves 19/05, 26/05, 02/06 y 09/06 de 13.30 a 15 hs.</p>', 'presencial', NULL, 1),
(131, NULL, 'Este curso tiene CONVOCATORIA ESPECÍFICA.', '<h2><span style="text-decoration: underline;"><strong>ATENCI&Oacute;N:</strong><strong>&nbsp;Se detalla a continuaci&oacute;n d&iacute;a que debe asistir cada jurisdiccion.</strong></span></h2><p>&nbsp;</p><p>&nbsp;</p><p><span style="text-decoration: underline;"><strong>Lunes 6 de JUNIO de 9 a 12hs</strong></span></p><p>&nbsp;</p><p><strong>1. IPDUV</strong></p><p><strong>2. Direcci&oacute;n de Vialidad Provincial</strong></p><p>&nbsp;<strong>3. Ministerio de Infraestructura y Servicios P&uacute;blicos</strong></p><p>&nbsp;<strong>4. APA</strong></p><p>&nbsp;<strong>5.&nbsp;Secretar&iacute;a de Inversiones, Asuntos Internacionales y Promoci&oacute;n</strong></p><p>&nbsp;<strong>6. Instituto de Cultura</strong></p><p>&nbsp;<strong>7. ATP</strong></p><p>&nbsp;<strong>8. Administraci&oacute;n Portuaria Puerto Barranqueras</strong></p><p>&nbsp;<strong>9. Instituto de Turismo</strong></p><p>&nbsp;<strong>10.&nbsp;Ministerio&nbsp;de Desarrollo Urbano y Territorial</strong></p><p>&nbsp;<strong>11. Secretar&iacute;a de Derechos Humanos</strong></p><p>&nbsp;<strong>12. Instituto del Deporte Chaque&ntilde;o</strong></p><p>&nbsp;<strong>13. Loter&iacute;a Chaque&ntilde;a</strong></p><p>&nbsp;<strong>14. ECOM Chaco</strong></p><p>&nbsp;</p><p><strong>DESTINATARIOS:</strong>&nbsp;</p><ul><li>Personal de las U.P .S&nbsp; de las diferentes jurisdicciones</li><li>&nbsp;Directores de Administraci&oacute;n de las diferentes jurisdicciones</li><li>Directores de Recursos Humanos de las diferentes jurisdicciones.<strong>&nbsp; &nbsp; &nbsp;</strong></li></ul><p><strong>DURACI&Oacute;N</strong>: 1 jornada de 3 (tres) horas reloj para cada jurisdicci&oacute;n.</p><p><strong>CRONOGRAMA</strong>:&nbsp;</p><ul><li><span lang="EN-GB">Lunes 06/06 &nbsp;de&nbsp;&nbsp;9 a 12&nbsp;hs.</span></li></ul><p><a href="../../../uploads/publicacion/9e215e5b15a7b0e681cb37d242ef79876b83d436.pdf" target="_blank">Ver detalles del curso aqu&iacute;</a