(132, NULL, 'Estará a cargo de la Abg. Daniela Cantalupi.', '<p>Destinatarios: A<span lang="ES-AR">gentes de la administraci&oacute;n p&uacute;blica con tareas sobre gesti&oacute;n de expedientes, confecci&oacute;n de proyectos de actos administrativos y asesor&iacute;a.</span></p><p><span lang="ES-AR"><strong>Fecha de inicio:</strong>&nbsp;Jueves&nbsp;16 de junio -&nbsp;</span><strong>Fecha de finalizaci&oacute;n</strong>: Lunes 11 de julio&nbsp;</p><p><a href="../../../uploads/publicacion/4a7a03e15916c064438125a60460becd80e907b7.pdf" target="_blank">Ver contenidos y cronograma aqu&iacute;</a></p><p><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></p><p>&nbsp;</p><div align="center"><strong><span lang="ES">IMPORTANTE</span></strong></div><div dir="ltr" align="center"><strong><span lang="ES">INSCRIPCI&Oacute;N</span></strong><span lang="ES">:&nbsp;</span>Para participar deber&aacute;&nbsp;<strong>pre-inscribirse</strong>&nbsp;en nuestra web&nbsp;<strong><a href="../../../" target="_blank">ipap.chaco.gov.ar</a></strong>&nbsp;y presentar&nbsp;<strong>a la brevedad</strong>&nbsp;el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe. <strong>CIERRE DE INSCRIPCI&Oacute;N: MARTES 14 DE JUNIO A LAS 13.</strong></div>', 'presencial', NULL, 1),
(133, NULL, 'Estará a cargo de las capacitadoras: Dra. Carola Centanaro, Directora de Sumarios (Asesoría General de Gobierno) y Dra. Claudia Geraldi- Directora  a/c Sumarios Docentes', '<p><strong>Destinatarios: &nbsp;</strong>&nbsp; &nbsp; Jefes de Departamentos</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Director de Recursos Humanos de las diferentes jurisdicciones</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Director&nbsp;&nbsp; General&nbsp; de Recursos Humanos</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores &nbsp;de las jurisdicciones</p><p>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Directores Generales</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores de Secretar&iacute;a General de las jurisdicciones</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Asesores legales de las jurisdicciones</p><p>&nbsp;</p><p><strong>CUPO: </strong>50 PARTICIPANTES</p><p><span lang="ES-AR"><strong>Fecha de inicio:</strong>&nbsp;Jueves 16 de junio -&nbsp;</span><strong>Fecha de finalizaci&oacute;n</strong>: Jueves 7 de julio&nbsp;</p><p><strong>D&iacute;a y Horario:</strong> &nbsp;jueves de 17 a 19.30 hs.</p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong>&nbsp;<strong>14 de junio a las 13</strong>&nbsp;<span lang="ES-AR">o <strong>una vez cubierto el cupo previsto</strong> para la actividad.</span></p><h2 style="text-align: center;"><a href="../../../uploads/publicacion