(139, NULL, 'Tendrán prioridad para participar en esta actividad quienes hayan completado el curso previo "Comunicación y Gestión de Conflictos en la Administración Pública".', '<h3><strong>Destinatarios principales:</strong>&nbsp;Quienes completaron el curso previo de &nbsp;<em>&ldquo;Comunicaci&oacute;n y Gesti&oacute;n de Conflictos en la Administraci&oacute;n P&uacute;blica&rdquo;. &nbsp;</em></h3><p><strong>Otros Perfiles:</strong></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores Generales, Directores y jefes de las jurisdicciones de la Administraci&oacute;n Central y de los Organismos descentralizados y aut&aacute;rquicos.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Responsable de equipos de proyectos y programas.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Personal integrante de equipos formalizados para implementaci&oacute;n y gesti&oacute;n&nbsp; de calidad en la Administraci&oacute;n P&uacute;blica.</p><p><strong><span lang="EN-GB">Duraci&oacute;n:&nbsp;</span></strong><span lang="EN-GB">Carga horaria total: 20 horas, distribuidas en 3 clases presenciales de 4 horas cada una y 8 horas de trabajo en aula virtual.&nbsp;</span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>Esta actividad requiere el 100 % de asistencia.</strong></p><p><strong><span lang="EN-GB">Clases presenciales:</span></strong><span lang="EN-GB">&nbsp;Sede IPAP Chaco, Arturo Illia 26</span></p><ul><li><span lang="EN-GB">Martes 28/6 16 a 20 hs.</span></li><li>Mi&eacute;rcoles 29/6 16 a 20 hs.</li><li>Martes 5/7 16 a 20 hs</li></ul><p><strong>Clases virtuales:&nbsp;</strong>se desarrollar&aacute;n en&nbsp;<a href="http://elearning.ipap.chaco.gov.ar/" target="_blank">http://elearning.ipap.chaco.gov.ar/</a></p><h2 style="text-align: center;">&nbsp;<a href="../../uploads/publicacion/5a2814332e81ef364849ff0993a02ef76d65a914.pdf" target="_blank">Ver contenidos y cronograma aqu&iacute;</a></h2><h2 style="text-align: center;">&nbsp;<a href="../../alumno/cursos/todos" target="_b