(153, NULL, 'Curso interno para ingresantes a IPAP Chaco - \r\n\r\nDIAS: 1/8 a 5/8. \r\n\r\nCARGA HORARIA TOTAL DE 12HS RELOJ – 3HS RELOJ  CADA MÓDULO.\r\n\r\nMÓDULO 1: SERVICIO DE EXCELENCIA EN LA ATENCIÓN DE USUARIOS -3HS- Prof. Sergio Geniadieff\r\n\r\nMÓDULO 2: ORGANIZACIÓN INTERNA DEL IPAP CHACO  -3HS- Integrantes del Equipo IPAP: Analí Roffé, Marco Avellaneda, Diego Latorre, Alejandra Maidana\r\n\r\nMÓDULO 3: ORGANIZACIÓN DEL ESTADO PROVINCIAL  -3HS- Lic. Soledad Brugnoli\r\n\r\nMÓDULO 4: DEBERES Y DERECHOS DEL EMPLEADO PÚBLICO -Ley N° 2017, Ley N° 3521 y Ley N° 1276-  -3HS- Lic. Soledad Brugnoli', '<p>Curso interno para ingresantes a IPAP Chaco -</p><p>DIAS: 1/8 a 5/8.</p><p>CARGA HORARIA TOTAL DE 12HS RELOJ &ndash; 3HS RELOJ CADA M&Oacute;DULO.</p><p>M&Oacute;DULO 1: SERVICIO DE EXCELENCIA EN LA ATENCI&Oacute;N DE USUARIOS -3HS- Prof. Sergio Geniadieff</p><p>M&Oacute;DULO 2: ORGANIZACI&Oacute;N INTERNA DEL IPAP CHACO -3HS- Integrantes del Equipo IPAP: Anal&iacute; Roff&eacute;, Marco Avellaneda, Diego Latorre, Alejandra Maidana</p><p>M&Oacute;DULO 3: ORGANIZACI&Oacute;N DEL ESTADO PROVINCIAL -3HS- Lic. Soledad Brugnoli</p><p>M&Oacute;DULO 4: DEBERES Y DERECHOS DEL EMPLEADO P&Uacute;BLICO -Ley N&deg; 2017, Ley N&deg; 3521 y Ley N&deg; 1276- -3HS- Lic. Soledad Brugnoli</p>', 'presencial', NULL, 1),
