(155, NULL, 'DESTINATARIOS, INSCRIPCIÓN Y ADMISIÓN: El curso está dirigido a todas aquellas personas con funciones formales en la definición, construcción, administración o mantenimiento de sitios Web del Gobierno del Chaco, con conocimientos de herramientas y lenguajes de desarrollo WEB.', '<div><strong>CURSO "ACCESIBILIDAD WEB"&nbsp;</strong></div><div>&nbsp;</div><div><strong>DESTINATARIOS, INSCRIPCI&Oacute;N Y ADMISI&Oacute;N:&nbsp;</strong>Perfil del destinatario:</div><div>&nbsp;</div><div>-Desarrollador y/o Programador de aplicaciones<br />-Desarrollador de p&aacute;ginas WEB</div><div>-Dise&ntilde;adores gr&aacute;ficos</div><div>&nbsp;</div><div>Por la especificidad de la actividad se detalla a continuaci&oacute;n los requisitos de&nbsp;<strong>inscripci&oacute;n y admisi&oacute;n:</strong><br />1)&nbsp;Completar y firmar el formulario de inscripci&oacute;n &nbsp;y compromiso de cursado por parte del agente participante y su jefe inmediato.<br />2) Presentar el formulario antes mencionado &nbsp;en la sede de IPAP Chaco&nbsp;hasta las 13hs el jueves 4 de agosto a las 13hs<br />3) La solicitudes ser&aacute;n analizadas por IPAP Chaco y podr&aacute;n los aspirantes ser<strong>&nbsp;entrevistados</strong>&nbsp;telef&oacute;nicamente.<br />4)&nbsp;IPAP Chaco notificar&aacute; la admisi&oacute;n al curso a trav&eacute;s del correo electr&oacute;nico consignado en formulario de inscripci&oacute;n.</div><div>&nbsp;</div><div>&nbsp;</div><h4><strong>&nbsp;Descargar:&nbsp;<a href="../../../uploads/publicacion/7b2015c24d991f76e3a5abdc4b41524020475f76.pdf" target="_blank">contenidos y cronograma aqu&iacute;</a>&nbsp;</strong></h4><h4><strong>Descargar:&nbsp;<a href="../../uploads/publicacion/7e3d601a45d00abfd44451d174cbc3bb13a7b6e5.pdf" target="_blank">Formulario de inscripci&oacute;n y compromiso-Accesibilidad Web</a></strong></h4><h4>&nbsp;</h4><div>&nbsp;</div><div><strong>INFORMES&nbsp;</strong></div><div><div><strong>&nbsp;</strong></div><div>Debido a las caracter