(159, NULL, 'Estará a cargo de la Lic. Claudia Gatti y la Mgter. Carolina Gómez.', '<h3><strong>Destinatarios&nbsp;</strong></h3><p>Directores Generales, Directores y jefes de las jurisdicciones de la Administraci&oacute;n Central y de los Organismos descentralizados y aut&aacute;rquicos.</p><p>Responsable de equipos de proyectos y programas.</p><p>Personal integrante de equipos formalizados para implementaci&oacute;n y gesti&oacute;n de calidad en la Administraci&oacute;n P&uacute;blica.</p><p><strong><span lang="EN-GB">Duraci&oacute;n:&nbsp;</span></strong><span lang="EN-GB">Carga horaria total: 15&nbsp;horas, distribuidas en 2 clases presenciales de 4 horas cada una y 7 horas de trabajo en aula virtual.&nbsp;</span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<strong>Esta actividad requiere el 100 % de asistencia.</strong></p><p><strong><span lang="EN-GB">Clases presenciales:</span></strong><span lang="EN-GB">&nbsp;Sede IPAP Chaco, Arturo Illia 26</span></p><ul><li><span lang="EN-GB">Lunes 22/8 16 a 20 hs.</span></li><li>Mi&eacute;rcoles 24/8 16 a 20 hs.</li></ul><p><strong>Clases virtuales:&nbsp;</strong>se desarrollar&aacute;n en&nbsp;<a href="http://elearning.ipap.chaco.gov.ar/">http://elearning.ipap.chaco.gov.ar/</a></p><h2 style="text-align: center;"><a href="../../../uploads/publicacion/fbfad66051bf9b6f2737b6d262b4633ca828c66e.pdf" target="_blank">Ver contenidos y cronograma aqu&iacute;</a></h2><h2 style="text-align: center;"><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></h2><p>La <strong>inscripci&oacute;n finaliza el VIERNES 19 DE AGOSTO A LAS 20 HS </strong>o <strong>UNA VEZ CUBIERTO EL CUPO PREVISTO</strong> para la actividad.</p><p>&nbsp;</p>', 'presencial', NULL, 1),
(160, NULL, 'Fortalecer a los agentes con funciones de atención de personas con conductas adictivas por consumo de sustancias, desarrollando habilidades sociales y comunicacionales para un abordaje eficaz y un adecuado acompañamiento en un plan ambulatorio.', '<p><strong>DESTINATARIOS:</strong></p><p><strong>Agentes de la Adinistraci&oacute;n P&uacute;blica de las siguientes jurisdicciones:</strong></p><p>- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ministerio de Seguridad y Polic&iacute;a de la Provincia del Chaco</p><p>- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ministerio de Desarrollo Social</p><p>- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Instituto del Deporte</p><p>- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Instituto de Cultura</p><p>- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ministerio de Educaci&oacute;n, Cultura, Ciencia y Tecnolog&iacute;a</p><p><strong>Agentes Sociales</strong></p><p><strong>Agentes municipales convocados a trav&eacute;s de la Secretar&iacute;a de Municipios y Ciudades.</strong></p><p><strong>&nbsp;</strong></p><p><strong><span lang="ES">DURACI&Oacute;N: &nbsp;</span></strong><span lang="ES">96</span><span lang="EN-GB">&nbsp;horas reloj, distribuidas en 6 (seis) encuentros&nbsp;de dieciseis (16) horas reloj cada uno, distribuidas en dos d&iacute;as (8 horas cada d&iacute;a).</span></p><p><span lang="EN-GB">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 26 y 27 de agosto, 2 y 3 de septiembre, 9 y 10 de septiembre, 23 y 24 de septiembre, 30 de septiembre y 1 de octubre, 7 y 8 de octubre de 9hs a 17hs.</span></p><p>&nbsp;</p><p><strong>ADMISI&Oacute;N:&nbsp;</strong>una vez analizadas las solicitudes IPAP chaco informar&aacute; a trav&eacute;s de su correo electr&oacute;nico consignado en la inscripci&oacute;n, la&nbsp;<em>admisi&oacute;n</em>&nbsp;o<em>&nbsp;no admisi&oacute;n</em>&nbsp;al curso.</p><p>&nbsp;</p><p style="text-align: center;"><strong>INFORMES</strong></p><p style="text-align: center;"><a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.c