(183, NULL, 'A cargo de la Lic. Andrea Sandobal. \r\nDirectora General de Modernización del Estado – Secretaría General de Gobierno y Coordinación.', '<p><strong>DESTINATARIOS:&nbsp;empleados del Estado Provincial, ingresados en los &uacute;ltimos a&ntilde;os a la planta Permanente de la Administraci&oacute;n P&uacute;blica y todo agente interesado en la tem&aacute;tica.</strong>&nbsp;<strong>Tendr&aacute;n prioridad en la inscripci&oacute;n aquellos agentes que residan en el interior de la provincia.</strong></p><p><strong>CRONOGRAMA:&nbsp;</strong>&nbsp;</p><p>11/10 - Publicaci&oacute;n Tema 1</p><p>17/10 - Publicaci&oacute;n Tema 2</p><p>24/10 - Publicaci&oacute;n Tema 3</p><p>31/10 - Publicaci&oacute;n Tema 4</p><p>EVALUACI&Oacute;N&nbsp;PRESENCIAL: 10/11 de 8 a 10hs</p><p><span lang="ES-AR">El correo que use para pre-inscribirse ser&aacute; utilizado para enviarle el usuario y contrase&ntilde;a para ingresar al curso en la plataforma virtual, por tal motivo es indispensable que el participante disponga de una <strong>CUENTA DE CORREO ELECTR&Oacute;NICO PERSONAL, V&Aacute;LIDA Y DE USO FRECUENTE. </strong></span></p><p><strong><span lang="ES-AR">La inscripci&oacute;n finaliza el 5 de octubre a las 20hs&nbsp;</span><span lang="ES-AR">(no se requerir&aacute; el formulario de inscripci&oacute;n impreso).</span></strong></p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/ecc67537d1fcd09c7d475abab3f76c5a4e46550e.pdf">CONTENIDOS Y CRONOGRAMA AQU&Iacute;</a></strong></p><p style="text-align: center;"><strong><span lang="ES-AR"><a href="../../alumno/cursos/todos">INSCRIPCI&Oacute;N AQU&Iacute;</a></span></strong></p><p>&nbsp;</p>', 'elearning', NULL, 1),
