(185, NULL, 'Estará a cargo de la Esp. Arq. Analía Myriam Piccini.', '<h3><strong>Destinatarios&nbsp;</strong></h3><p>Jefes de Departamento y personal operativo que por sus funciones y responsabilidades &nbsp;<strong>deban hacer uso de an&aacute;lisis estad&iacute;sticos</strong>, y se desempe&ntilde;en en : &nbsp;</p><p>* &Aacute;reas de Estad&iacute;sticas o similares de:</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Salud</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Producci&oacute;n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Planificaci&oacute;n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Desarrollo Social</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Hacienda y Finanzas P&uacute;blicas</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;o&nbsp;&nbsp; Ministerio de Infraestructura y Servicios P&uacute;blicos</p><p>*Unidades de Planificaci&oacute;n Sectorial de la Administraci&oacute;n&nbsp; Central</p><p>*Organismos descentralizados y aut&aacute;rquicos</p><p>*Agentes con proyectos de Investigaci&oacute;n presentados en IPAP CHACO</p><p><strong><span lang="EN-GB">Duraci&oacute;n:&nbsp;</span></strong><span lang="EN-GB">Carga horaria total: 36&nbsp;horas reloj, distribuidas en 6 clases presenciales de 3 horas cada una y 18 horas de trabajo en aula virtual.&nbsp;</span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p><strong><span lang="EN-GB">Clases presenciales:</span></strong><span lang="EN-GB">&nbsp;Sede IPAP Chaco, Arturo Illia 26</span></p><ul><li><span lang="EN-GB">Clase 1: Viernes&nbsp;23/09 de 11.30 a 14.30 hs.</span></li><li><span lang="EN-GB">Clase 2:&nbsp;Viernes 30/09 de&nbsp;11.30 a 14.30 hs.</span></li><li><span lang="EN-GB">Clase 3:&nbsp;Viernes 07/10 de&nbsp;11.30 a 14.30 hs.</span></li><li><span lang="EN-GB">Clase 4:&nbsp;Viernes 21/10 de&nbsp;11.30 a 14.30 hs.</span></li><li><span lang="EN-