(192, NULL, 'Perfil específico de los destinatarios: personal que tengan contacto directo de atención al público o cuya función implique transmitir información, asesoramiento, contención u orientación al ciudadano o que tenga funciones operativas específicas en los servicios esenciales, críticos y de emergencia.', '<p><strong><span lang="ES">DESTINATARIOS:</span></strong></p><p>Dirigido al personal de diferentes Organismos de la Administraci&oacute;n P&uacute;blica, que tengan contacto directo de atenci&oacute;n al p&uacute;blico o cuya funci&oacute;n implique transmitir&nbsp; informaci&oacute;n, asesoramiento, contenci&oacute;n u orientaci&oacute;n al ciudadano.</p><p><strong>Tendr&aacute;n prioridad en la inscripci&oacute;n el personal con funciones operativas espec&iacute;ficas en los servicios esenciales,&nbsp; cr&iacute;ticos y de emergencia de los siguientes organismos y oficinas de:</strong></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Polic&iacute;a de la provincia del Chaco</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Desarrollo Social</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Salud P&uacute;blica</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Oficinas de atenci&oacute;n al p&uacute;blico de las jurisdicciones&nbsp;</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Centro de Gesti&oacute;n de Casa de Gobierno</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mesas de entradas de las jurisdicciones</p><p><strong>FECHA INICIO: Jueves 13 de&nbsp;OCTUBRE</strong></p><p><strong>FINALIZA: Jueves 01 de Diciembre</strong></p><p><strong><a href="../../uploads/publicacion/6863dbdb9cff9a296fcc600bf38adfff1735d245.pdf" target="_blank">Ver cronograma y detalles del curso aqu&iacute;</a></strong></p><p><a href="../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n Aqu&iacut