(196, NULL, 'El jueves 6 de octubre, el IPAP Chaco presentó en la Feria del Libro Chaqueño y Regional, Infantil y Juvenil en la localidad de Charata, la disertación: “Excelencia en Atención al Público” a cargo del Lic. Sergio Geniadieff. Este espacio de formación fue dirigido principalmente a empleados públicos municipales y provinciales de Charata y su zona de influencia, como así también al público en general que le interese la temática, y contó con certificación digital de asistencia para los participantes.\r\n\r\nAdemás, el stand de IPAP Chaco brindó información de sus objetivos, cursos, proyectos de investigación y todo lo relacionado a su quehacer al público local y de la región que visito la feria.', NULL, 'presencial', NULL, 1),
(197, NULL, 'DESTINATARIOS: Agentes del estado provincial con funciones y responsabilidades actuales sobre instalación, mantenimiento e inspección de instalaciones eléctricas de los edificios públicos.', '<h2 class="Default"><strong>Tendr&aacute;n prioridad el personal que haya aprobado en el ciclo 2015 los cursos de:</strong></h2><p class="Default">&nbsp;</p><p class="Default"><!-- [if !supportLists]-->-&nbsp;&nbsp;<strong>MANTENIMIENTO INTALACIONES SANITARIAS EN EDIFICIOS, y </strong></p><p class="Default"><!-- [if !supportLists]-->-&nbsp;&nbsp;<strong>SEGURIDAD EL&Eacute;CTRICA Y PRINCIPIOS DE MANTENIMIENTO EL&Eacute;CTRICO EN EDIFICIOS P&Uacute;BLICOS </strong></p><p class="Default">&nbsp;</p><p class="Default"><strong>CRONOGRAMA:</strong></p><p class="Default">Clase 1: FECHA: 1 de noviembre - Horario: 7.30 hs a 10.30 hs</p><p>Clase 2: FECHA: 4 de Noviembre - Horario: 07:30 Hs a 10:30 Hs</p><p>Clase 3: FECHA: 8 de Noviembre - Horario: 7:30 Hs a 10:30 Hs</p><p>Clase 4: FECHA: 11 de Noviembre - Horario: 7:30 Hs a 10:30 Hs</p><p>Clase 5: FECHA: 15 de Noviembre - Horario: 7:30 Hs a 10:30 Hs</p><p>Clase 6: FECHA: 18 de Noviembre - Horario: 7:30 Hs a 10:30 Hs</p><p>Clase 7: FECHA: 22 de noviembre - Horario: 7:30 Hs a 10:30 Hs</p><p><strong>EVALUACI&Oacute;N (DEFENSA DEL TRABAJO FINAL) :</strong>FECHA: 25 de Noviembre Horario: 7:30 Hs a 10:30 Hs</p><p>&nbsp;</p><p><strong>Lugar de realizaci&oacute;n&nbsp;:Sindicato Luz y Fuerza Mercedes.Aulas: Instituto Fundaluz XXI ISEP 13 de Julio UEP N&ordm; 122, Av. Paraguay N&ordm; 743.</strong></p><p><strong>INSCRIPCI&Oacute;N: </strong><strong>Para participar deber&aacute; pre-inscribirse y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso. La inscripci&oacute;n finaliza el JUEVES 27 DE OCTUBRE A LAS 20 HS o UNA VEZ CUBIERTO EL CUPO PREVISTO para la actividad.</strong></p><p>&nbsp;</p><p>&nbsp;</p><h2 align="center"><a href="../../../uploads/publicacion/