al1"><span lang="ES-AR">Clase 10: FECHA: 23/11/16&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - <strong>Horario: 7.30 hs a 10.00 hs</strong></span></p><p class="Normal1"><span lang="ES-AR">Clase 11: FECHA: 30/11/16&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - <strong>Horario: 7.30 hs a 10.00 hs</strong></span></p><p class="Normal1"><span lang="ES-AR">Clase 12: FECHA: 05/12/16&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - <strong>Horario: 7.30 hs a 10.00 hs</strong></span></p><p class="Normal1"><span lang="ES-AR">Semana de 06/12/2016 al 15/12/2016: Entrega trabajos finales v&iacute;a campus IPAP CHACO.</span></p>', 'presencial', NULL, 1),
(199, NULL, 'DESTINATARIOS: Empleados Públicos que estén en la actualidad en condiciones de acceder al beneficio jubilatorio  -o se encuentren en dicha condición dentro de uno a dos años- cualquiera sea su categoría laboral y dedicación.', '<h2 style="text-align: center;"><strong>Inicio jueves 27 de octubre a las 16.30h</strong></h2><h2 style="text-align: center;"><strong>Lugar IPAP Chaco - Arturo iIlia 26</strong></h2><h2 style="text-align: center;"><a href="../../alumno/cursos/todos"><strong>INSCRIPCI&Oacute;N AQU&Iacute;</strong></a></h2><h2 style="text-align: center;">Si necesita orientaci&oacute;n para inscribirse no dude contactarnos</h2><h2 align="center">4453723 &ndash; ipapchaco@gmail.com</h2><p><strong>&nbsp;</strong><strong>&nbsp;<br /></strong></p><p>Se implementar&aacute;n actividades&nbsp;enmarcadas en 3 ejes:</p><ul><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salud f&iacute;sica y psicol&oacute;gica.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; La administraci&oacute;n econ&oacute;mica y financiera, micro emprendimientos, gesti&oacute;n del dinero.&nbsp;</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; El conocimiento de la normatividad vigente asociada a la jubilaci&oacute;n y de seguridad social.</li></ul><p>Se realizar&aacute;n 2 talleres y una charla informativa a cargo de profesionales,distribuy&eacute;ndose en 10 encuentros presenciales. &nbsp;Cada actividad responde a los ejes antes mencionados.</p><p>&nbsp;</p><p><strong>ACERCA DEL PROGRAMA</strong></p><p>El <strong>Programa de Orientaci&oacute;n para la Actividad Pasiva</strong> creado en el a&ntilde;o 2015 por <strong><a href="../../../uploads/publicacion/d92fbfa86ace477541bd64c39c4109a52482019b.pdf">Decreto N&deg; 2199</a></strong>. En l&iacute;nea con la Responsabilidad Social Gubernamental hacia sus empleados, &nbsp;tiene por objetivo preparar a los destinatarios a&nbsp; entender el retiro como una oportunidad de seguir manteni&eacute;ndose en actividad,&nbsp; brindando&nbsp; estrategias para encarar actividades productivas que les interesen y les posibiliten una inserci&oacute;n atenuada en esta nueva etapa de su vida.</p><h2>&nbsp;</h2><p><img style="display: block; margin-left: auto; margin-right: auto;" src="../../../uploads/imagen_publicacion/dfb86e1486649a380d369d74a518619c9ede77eb.jpeg" alt="Jubilaci&oacute;n" width="678" height="960" /></p><p>&nbsp;</p><p>&nbsp;</p><p>ads/imagen_publicacion/dfb86e1486649a380d369d74a518619c9ede77eb.jpeg&nbsp;</p>', 'presencial', NULL, 0),
(200, NULL, 'Estará a cargo de la Mgter. Emilia Lerner', '<h2><strong>DESTINATARIOS:&nbsp;</strong></h2><h2>Cuadros pol&iacute;ticos, Directores GeneraleS, Directores, Jefes de Departamento, Responsables de gesti&oacute;n en las empresas del Estado.</h2><p><strong>DURACI&Oacute;N:&nbsp;</strong></p><p>Carga horaria total: 24 horas, distribuidas en seis (6) clases presenciales de cuatro (4) horas reloj cada una: <strong>viernes</strong> de 9:00 hs a 13:00 hs y de 14:30 hs a 18:30 hs y <strong>s&aacute;bados</strong>&nbsp;de 8:00 hs a 12:00 hs.</p><p><strong>CRONOGRAMA:</strong></p><p>VIERNES 04/11 - S&Aacute;BADO 05/11</p><p>VIERNES 11/11 - S&Aacute;BADO 12/11</p><h2 style="text-align: center;"><strong><a href="../../../uploads/publicacion/1158849140f3f05535ad6f60b8eeb7231efc22d3.pdf" target="_blank">CONTENIDOS Y CRONOGRAMA AQU&Iacute;</a></strong></h2><h2 style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></h2>', 'presencial', NULL, 1),
(201, NULL, 'A cargo de la Lic. Andrea Sandobal. \r\nDirectora General de Modernización del Estado – Secretaría General de Gobierno y Coordinación.', '<p><strong>DESTINATARIOS:&nbsp;empleados del Estado Provincial, ingresados en los &uacute;ltimos a&ntilde;os a la planta Permanente de la Administraci&oacute;n P&uacute;blica y todo agente interesado en la tem&aacute;tica.</strong>&nbsp;<strong>Tendr&aacute;n prioridad en la inscripci&oacute;n aquellos agentes que residan en el interior de la provincia.</strong></p><p><strong>CRONOGRAMA:&nbsp;</strong>&nbsp;</p><p>09/11 - Publicaci&oacute;n Tema 1</p><p>14/11 - Publicaci&oacute;n Tema 2</p><p>21/11 - Publicaci&oacute;n Tema 3</p><p>29/11 - Publicaci&oacute;n Tema 4</p><p>EVALUACI&Oacute;N&nbsp;PRESENCIAL: 06/12&nbsp;de 8 a 10hs</p><p><span lang="ES-AR">El correo que use para pre-inscribirse ser&aacute; utilizado para enviarle el usuario y contrase&ntilde;a para ingresar al curso en la plataforma virtual, por tal motivo es indispensable que el participante disponga de una&nbsp;<strong>CUENTA DE CORREO ELECTR&Oacute;NICO PERSONAL, V&Aacute;LIDA Y DE USO FRECUENTE.</strong></span></p><p><strong><span lang="ES-AR">La inscripci&oacute;n finaliza el 9 de noviembre&nbsp;a las 20hs&nbsp;</span><span lang="ES-AR">(no se requerir&aacute; el formulario de inscripci&oacute;n impreso).</span></strong></p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/f3e613a7a1af1a883801b7417cee79c070943fd6.pdf" target="_blank">CONTENIDOS Y CRONOGRAMA AQU&Iacute;</a></strong></p><p style="text-align: center;"><strong><a href="../../alumno/cursos/todos" target="_blank">INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;">&nbsp;</p>', 'elearning', NULL, 0),
