(207, NULL, 'Estará a cargo de la Coordinadora de la Vocalía Pasiva de INSSSEP Carmen Beatriz Cuenca.', '<p>Esta actividad est&aacute; enmarcada en el <strong>Programa de Orientaci&oacute;n para la Actividad Pasiva</strong>.</p><h2 style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></strong></h2><h3 style="text-align: center;">Si necesita orientaci&oacute;n para inscribirse, no dude en contactarnos</h3><h3 style="text-align: center;">4453723 &ndash; <a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a></h3><h2 style="text-align: center;"><strong><a href="../../../uploads/publicacion/047b36765d8d6bb64a94c09a145fd8a48ca6d5f6.pdf" target="_blank">Ver tem&aacute;ticas a desarrollarse</a></strong></h2><p><strong>ACERCA DEL PROGRAMA</strong></p><p>El&nbsp;<strong>Programa de Orientaci&oacute;n para la Actividad Pasiva</strong>&nbsp;creado en el a&ntilde;o 2015 por&nbsp;<strong><a href="../../../uploads/publicacion/d92fbfa86ace477541bd64c39c4109a52482019b.pdf">Decreto N&deg; 2199</a></strong>. En l&iacute;nea con la Responsabilidad Social Gubernamental hacia sus empleados, &nbsp;tiene por objetivo preparar a los destinatarios a&nbsp; entender el retiro como una oportunidad de seguir manteni&eacute;ndose en actividad,&nbsp; brindando&nbsp; estrategias para encarar actividades productivas que les interesen y les posibiliten una inserci&oacute;n atenuada en esta nueva etapa de su vida.</p><p>Previo a esta jornada informativa, y como parte del programa, se dictan los talleres:</p><p>*&nbsp;EL PROCESO JUBILATORIO: REFLEXIONES Y DESAF&Iacute;OS - Finalizado</p><p>* APRENDIENDO A EMPRENDER - En desarrollo</p><h2 style="text-align: center;">&nbsp;</h2>', 'presencial', NULL, 0),
