(213, NULL, 'Este curso tiene CONVOCATORIA ESPECÍFICA.', '<h2><span><strong>ATENCI&Oacute;N:</strong><strong>&nbsp;Se detalla a continuaci&oacute;n d&iacute;a que debe asistir cada jurisdiccion.</strong></span></h2><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong><span>Mi&eacute;rcoles 8 de JUNIO de 9 a 12hs</span>&nbsp;</strong></p><p>&nbsp;</p><p><strong>1. Secretar&iacute;a General de Gobierno y Coordinaci&oacute;n</strong></p><p>&nbsp;<strong>2.&nbsp;Ministerio&nbsp;de Gobierno y Relaci&oacute;n con la Comunidad</strong></p><p>&nbsp;<strong>3. Ministerio de Producci&oacute;n</strong></p><p>&nbsp;<strong>4. Ministerio de Salud P&uacute;blica</strong></p><p>&nbsp;<strong>5. Ministerio Industria, Comercio y Servicios</strong></p><p>&nbsp;<strong>6. Instituto de Colonizaci&oacute;n&nbsp;</strong></p><p>&nbsp;<strong>7. Instituto de&nbsp;Investigaciones&nbsp;Forestales y Agropecuarias (IIFA)</strong></p><p>&nbsp;<strong>8. Polic&iacute;a Provincial del Chaco</strong></p><p>&nbsp;<strong>9. Ministerio de Desarrollo Social</strong></p><p>&nbsp;<strong>10. Ministerio&nbsp;de Educaci&oacute;n, Cultura, Ciencia y Tecnolog&iacute;a&nbsp;</strong></p><p>&nbsp;<strong>11. Servicio Penitenciario y de Readaptaci&oacute;n Social.</strong></p><p>&nbsp;<strong>12. IPRODICH</strong></p><p>&nbsp;<strong>13. Ministerio de Seguridad</strong></p><p>&nbsp;<strong>14. Secretar&iacute;a de Municipios y&nbsp;Ciudades</strong></p><p>&nbsp;<strong>15. Instituto de Desarrollo Rural y Agricultura Familiar</strong></p><p>&nbsp;<strong>16. INSSSEP&nbsp;</strong></p><p>&nbsp;<strong>17 Ministerio de Hacienda y Finanzas.</strong></p><p>&nbsp;</p><p><strong>DESTINATARIOS:</strong>&nbsp;</p><ul><li>Personal de las U.P .S&nbsp; de las diferentes jurisdicciones</li><li>&nbsp;Directores de Administraci&oacute;n de las diferentes jurisdicciones</li><li>Directores de Recursos Humanos de las diferentes jurisdicciones.<strong>&nbsp; &nbsp; &nbsp;</strong></li></ul><p><strong>DURACI&Oacute;N</strong>: 1 j