(234, NULL, 'ACTIVIDAD EXCLUSIVA PARA  REFERENTES DE LAS ÁREAS INFORMÁTICAS DE LAS JURISDICCIONES CENTRALES, ORGANISMOS DESCENTRALIZADOS Y AUTÁRQUICOS CONVOCADOS POR LA DIRECCIÓN GENERAL DE TICS.', '<p><strong>FUNDAMENTACI&Oacute;N</strong></p><p>La ADMINISTRACI&Oacute;N P&Uacute;BLICA PROVINCIAL no puede permanecer ajena a los avances y a la aplicaci&oacute;n de las nuevas tecnolog&iacute;as de gesti&oacute;n, informaci&oacute;n y comunicaci&oacute;n, ya que las mismas contribuyen al incremento de la productividad de los organismos y a optimizar el manejo de la informaci&oacute;n, reduciendo los costos asociados a su traslado y archivo.</p><p>Para lograr la prestaci&oacute;n de servicios m&aacute;s eficientes y ofrecer las m&aacute;ximas garant&iacute;as de seguridad para satisfacer apropiadamente las demandas de la poblaci&oacute;n y evitar la comisi&oacute;n de il&iacute;citos, se torna necesario que cada organismo del Sector P&uacute;blico Provincial sea capaz de prevenir que sus sistemas de informaci&oacute;n se vean afectados, implementando a tal fin pol&iacute;ticas de seguridad, procedimientos internos y sistemas de prevenci&oacute;n.</p><p>Con el fin de facilitar la elaboraci&oacute;n y ejecuci&oacute;n de las pol&iacute;ticas mencionadas y elevar los niveles de seguridad de los sistemas de informaci&oacute;n de los organismos p&uacute;blicos, deviene necesario establecer una Pol&iacute;tica de Seguridad Modelo y dictar las normas aclaratorias y complementarias correspondientes.</p><p><strong>DESTINATARIOS</strong></p><p>Referentes Inform&aacute;ticos y suplentes, designados por la m&aacute;xima autoridad de los organismos.&nbsp;</p><p style="text-align: center;"><a href="../../../alumno/cursos/todos">Pre-inscripci&oacute;n aqu&iacute;</a></p>', 'elearning', NULL, 1),
(235, NULL, 'Inicia martes 25/04. Capacitadora: Srta. María Laura Acuña.', '<p>Tendr&aacute;n prioridad en las inscripciones los Organismos que figuran a continuaci&oacute;n:</p><ul><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DESARROLLO URBANO Y ORDENAMIENTO TERRITORIAL.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; POLIC&Iacute;A DEL CHACO.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DE EDUCACI&Oacute;N, CULTURA, CIENCIA Y TECNOLOG&Iacute;A.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; INSSSEP.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DE INDUSTRIA, COMERCIO Y SERVICIOS.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DE HACIENDA Y FINANZAS.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FISCAL&Iacute;A DE ESTADO.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DE PRODUCCI&Oacute;N.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MINISTERIO DE GOBIERNO, JUSTICIA Y RELACI&Oacute;N CON LA COMUNIDAD.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ECOM.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; IPDUV.</li></ul><p>&nbsp;</p><p><strong>IMPORTANTE:</strong>&nbsp;Eval&uacute;e el d&iacute;a y horario conveniente para capacitarse y luego inscr&iacute;base en uno de los cursos. Entregue el&nbsp;<strong>formulario generado por el sistema</strong>, a la mayor brevedad,&nbsp;para completar su inscripci&oacute;n.</p><p>&nbsp;</p><p style="text-align: center;"><strong>PASOS PARA PRE-INSCRIBIRSE A LOS CURSOS AVANZADOS</strong></p><ol><li>&nbsp;&nbsp; Si desea realizar los cursos de&nbsp;<strong>ofim&aacute;tica AVANZADOS (WORD AVANZADO ),</strong>&nbsp;primero deber&aacute; realizar un&nbsp;<strong>TEST</strong>&nbsp;para validar sus conocimientos b&aacute;sicos de ofim&aacute;tica&nbsp;&nbsp;<a href="http://app.ipap.chaco.gov.ar/test/index.php">app.ipap.chaco.gov.ar/test/</a>&nbsp;</li></ol><p>&nbsp;</p><o