(236, NULL, 'ORIENTADO EXCLUSIVAMENTE A LOS AGENTES DESIGNADOS POR AUTORIDADES COMPETENTES EN EL ÁMBITO DE LA ADMINISTRACIÓN PÚBLICA PROVINCIAL.\r\nLA ADMISIÓN DE LOS PARTICIPANTES AL CURSO ESTARÁ A CARGO DE LA DIRECCIÓN DE INNOVACIÓN DE GESTIÓN.', '<p><strong>CAPACITADORES:</strong>&nbsp;Lic. Mar&iacute;a S&aacute;nchez Dansey, Ing. Georgina Pereira y Sr. Mart&iacute;n Aguirre.</p><p><strong>FUNDAMENTACI&Oacute;N:</strong></p><p>La Carta Iberoamericana de Gobierno Electr&oacute;nico reconoce como un derecho del ciudadano la posibilidad de que &eacute;ste pueda relacionarse electr&oacute;nicamente con el Estado. Esto implica que los organismos est&eacute;n preparados e interrelacionados entre s&iacute; para simplificar los procedimientos. Debemos reconocer y permitirle ejercer al ciudadano el derecho de informarse y gestionar tr&aacute;mites electr&oacute;nicamente desde cualquier lugar, adoptando nuevas tecnolog&iacute;as y adecuando tambi&eacute;n normas y procedimientos. Por ello, como Estado tenemos la obligaci&oacute;n de garantizar ese derecho, impulsando el uso de las tecnolog&iacute;as de informaci&oacute;n y comunicaci&oacute;n para brindar un servicio al ciudadano eficiente y eficaz, facilitando as&iacute; la informaci&oacute;n que al mismo le interesa y la agilizaci&oacute;n en la realizaci&oacute;n de los tr&aacute;mites. Como acci&oacute;n concreta para hacer realidad los fines del Gobierno Electr&oacute;nico y de un Estado Moderno proponemos la implementaci&oacute;n del sistema inform&aacute;tico web &ldquo;Gu&iacute;a de tr&aacute;mites&rdquo;, acercando de esta manera el Estado al ciudadano a trav&eacute;s del uso de las tecnolog&iacute;as de la informaci&oacute;n y la comunicaci&oacute;n.</p><p>&nbsp;</p><p><a href="../../../uploads/publicacion/581bca0b885f8a2a9fc9c670f695c98b2c2a0626.pdf">Ingresar aqu&iacute; para m&aacute;s informaci&oacute;n</a>&nbsp;</p><p><a href="../../../alumno/cursos/todos" target="_blank">Pre-Inscripci&oacute;n aqu&iacute;</a></p>', 'presencial', NULL, 1),
(238, NULL, 'Módulo 1: Organización, preservación y  manejo de expedientes (6hs). Módulo 2: Normativa Vigente para la Gestión de las mesas de Entrada (6 hs). Módulo 3: Sistema Informático de mesa de entradas del INSSSEP (3 hs).', '<p><strong>Inicia el 15/3 a las 7.30hs</strong></p><p>&nbsp;</p><p><strong>Contenidos:</strong></p><p><strong>M&Oacute;DULO 1: ORGANIZACI&Oacute;N, PRESERVACI&Oacute;N Y MANEJO DE EXPEDIENTES (ARCHIVOS ACTIVOS archivos de oficinas o de gesti&oacute;n):</strong></p><p><strong>M&Oacute;DULO 2: NORMATIVA VIGENTE PARA LA GESTI&Oacute;N DE LAS MESAS DE ENTRADAS</strong></p><p><strong>M&Oacute;DULO 3:</strong>&nbsp;<strong>SISTEMA INFORM&Aacute;TICO DE MESA DE ENTRADAS DEL INSSSEP</strong></p><p>&nbsp;</p><p>Cupo: la primera comisi&oacute;n se encuentra cubierta. Se comunicar&aacute; oportunamente pr&oacute;ximas ediciones del curso.</p><p>&nbsp;</p><h3 style="text-align: center;"><strong>&nbsp;<a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></h3><p>&nbsp;</p><p><strong>&nbsp;</strong></p>', 'presencial', NULL, 1),
(239, NULL, 'La actividad estará a cargo del Lic. Sergio Geniadieff.', '<p>La responsabilidad principal del empleado p&uacute;blico es la atenci&oacute;n de la ciudadan&iacute;a, esta acci&oacute;n compromete aptitudes y actitudes de cada uno de los trabajadores del estado.</p><p>Sensibilizar en los conceptos b&aacute;sicos involucrados en cada acto de atenci&oacute;n del ciudadano es fundamental para la formaci&oacute;n del empleado p&uacute;blico.</p><p>En este sentido las actividades de la jornada apuntan al conocimiento e informaci&oacute;n de conceptos de servicio actuales para poder aplicar el &aacute;mbito laboral.</p><p>Durante&nbsp;la jornada de tres (3) horas haremos foco en el objetivo de prestar una atenci&oacute;n personalizada y con alto desempe&ntilde;o, para conseguir una imagen positiva de la ciudadan&iacute;a.</p><p>&nbsp;</p><p><strong>CRONOGRAMA</strong>:</p><p>GRUPO 1 - MARTES 28/03 de 7:30 a 10:30 HS. (&Uacute;NICO ENCUENTRO)</p><p>&nbsp;</p><p style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">Pre inscripci&oacute;n aqu&iacute;</a></strong></p>', 'presencial', NULL, 1),
