(245, NULL, 'DESTINATARIOS EXCLUSIVOS: Personal de la Administración Pública Provincial que cumple funciones como chofer del Servicio de agua y Mantenimiento. Empresa del Estado Provincial. (SAMEEP).', '<p>La actividad surge del trabajo articulado entre la Subsecretar&iacute;a de Seguridad Vial, la empresa del Estado SAMEEP e IPAP y es r&eacute;plica de la capacitaci&oacute;n realizada en Resistencia en 2016.</p><p>&nbsp;</p><p style="text-align: center;"><strong>Ante cualquier inconveniente en el proceso de inscripci&oacute;n, dirigirse al &aacute;rea de Recursos Humanos de SAMEEP o a IPAP.</strong></p>', 'presencial', NULL, 1),
(246, NULL, 'La actividad estará a cargo del Lic. Sergio Geniadieff.', '<p>La responsabilidad principal del empleado p&uacute;blico es la atenci&oacute;n de la ciudadan&iacute;a. Esta acci&oacute;n compromete aptitudes y actitudes de cada uno de los trabajadores del estado.</p><p>Sensibilizar en los conceptos b&aacute;sicos involucrados en cada acto de atenci&oacute;n del ciudadano es fundamental para la formaci&oacute;n del empleado p&uacute;blico.</p><p>En este sentido las actividades de la jornada apuntan al conocimiento e informaci&oacute;n de conceptos de servicio actuales para poder aplicar en el &aacute;mbito laboral.</p><p>Durante&nbsp;la jornada de seis&nbsp;(6) horas haremos foco en el objetivo de prestar una atenci&oacute;n personalizada y con alto desempe&ntilde;o, para conseguir una imagen positiva de la ciudadan&iacute;a.</p><p>&nbsp;</p><p><strong>CRONOGRAMA</strong>:</p><p>MARTES 11/04 de 8:30 a 14:30 HS. (&Uacute;NICO ENCUENTRO)</p><p><strong>&nbsp;</strong></p><p style="text-align: center;"><strong>IMPORTANTE</strong></p><p>Para <strong>participar</strong> deber&aacute; en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo y presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso el d&iacute;a 11/4 a las 8.00hs.</p><p>La pre-inscripci&oacute;n online finaliza el <strong>10/04/17 a las 13hs</strong> o una vez cubierto el cupo previsto para la jornada. (Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email ipapchaco@gmail.com.</strong></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/ea5de9a480fc8882e0421b5b9c33a8d4f92ea117.pdf" target="_blank">CONTENIDOS Y CRONOGRAMA AQ