(249, NULL, 'NUEVO CURSO a realizarse el día 18/04. La actividad estará a cargo del Lic. Sergio Geniadieff.', '<p style="text-align: justify;"><strong><em><span style="text-decoration: underline;">ACLARACI&Oacute;N:</span> SE CERR&Oacute; LA INSCRIPCI&Oacute;N PARA&nbsp;LA JORNADA DEL D&Iacute;A 11/04 POR HABERSE COMPLETADO EL CUPO PREVISTO. DEBIDO A LA GRAN CONVOCATORIA HEMOS INCORPORADO ESTA NUEVA FECHA <br /></em></strong></p><p>&nbsp;</p><p style="text-align: justify;">La responsabilidad principal del empleado p&uacute;blico es la atenci&oacute;n de la ciudadan&iacute;a. Esta acci&oacute;n compromete aptitudes y actitudes de cada uno de los trabajadores del estado.</p><p style="text-align: justify;">Sensibilizar en los conceptos b&aacute;sicos involucrados en cada acto de atenci&oacute;n del ciudadano es fundamental para la formaci&oacute;n del empleado p&uacute;blico.</p><p style="text-align: justify;">En este sentido las actividades de la jornada apuntan al conocimiento e informaci&oacute;n de conceptos de servicio actuales para poder aplicar en el &aacute;mbito laboral.</p><p style="text-align: justify;">Durante&nbsp;la jornada de seis&nbsp;(6) horas haremos foco en el objetivo de prestar una atenci&oacute;n personalizada y con alto desempe&ntilde;o, para conseguir una imagen positiva de la ciudadan&iacute;a.</p><p style="text-align: justify;">&nbsp;</p><p><strong>CRONOGRAMA</strong>:</p><p><strong>MARTES 18/04</strong> de 8:30 a 14:30 HS. (&Uacute;NICO ENCUENTRO)</p><p><strong>&nbsp;</strong></p><p><strong>IMPORTANTE</strong></p><p style="text-align: justify;">Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; &nbsp;ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo y presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso el d&iacute;a 18/4 a las 8.00hs.</p><p style="text-align: justify;">La pre-inscripci&oacute;n online finaliza el&nbsp;<strong>17/04/17 a