municarse con IPAP de 7 a 20hs llamando al 03624-4456416 o a trav&eacute;s del email <a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><strong><a href="../../uploads/publicacion/c26f5d91649e42ef1c0ed8c1f93ead00d6a16da1.pdf" target="_blank">CONTENIDOS Y CRONOGRAMA AQU&Iacute;</a></strong></p><p style="text-align: center;"><strong><a href="../../alumno/cursos/todos" target="_blank">PRE-INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></p>', 'presencial', NULL, 1),
