(256, NULL, 'Destinatarios: Legisladores y equipos técnicos de la legislatura de la Provincia del Chaco. Alta Dirección Pública de la provincia.', '<p>CAPACITADOR: Dr. Orlando Pulvirenti</p><p>MODALIDAD: Presencial</p><p>CRONOGRAMA: Jueves 27/04 de 8 a 15.30 hs.</p><p>&nbsp;8.00 hs-Recepci&oacute;n y acreditaci&oacute;n</p><p>&nbsp;8.30 hs-Apertura a cargo de autoridades del Ministerio de Modernizaci&oacute;n de la Naci&oacute;n y autoridades provinciales.</p><p>&nbsp;9.00 a 12.30 hs- Primer Bloque Tem&aacute;tico</p><p>&nbsp;12.30 a 13.15 hs- Almuerzo libre</p><p>&nbsp;13.15 a 13.30 hs-Acreditaci&oacute;n</p><p>&nbsp;13.30 a 15.30 hs-Segundo Bloque Tem&aacute;tico y cierre de actividad.</p><p>&nbsp;<a href="../../../alumno/cursos/todos" target="_blank">INSCRIPCI&Oacute;N AQU&Iacute;</a></p>', 'presencial', NULL, 1),
(257, NULL, 'A cargo de la Lic. María Soledad Brugnoli.', '<p>De acuerdo con el Estatuto del Empleado p&uacute;blico, lograr la profesionalizaci&oacute;n del empleo p&uacute;blico requiere que los recursos humanos conozcan el marco jur&iacute;dico que organiza y rige su puesto de trabajo, as&iacute; como los deberes y responsabilidades estatutarios. Se observa entonces, la necesidad de destinar al personal del Estado provincial, ingresado en el corto plazo, un espacio de formaci&oacute;n inicial inductiva sobre la responsabilidad laboral y sus derechos, deberes y obligaciones, establecidos en la normativa vigente para el empleado p&uacute;blico de la Provincia del Chaco.</p><p><strong>DESTINATARIOS</strong>:&nbsp;Empleados del Estado Provincial comprendidos en la ley 2017, ingresados en el corto plazo a la planta Permanente o Transitoria.</p><p><strong>CRONOGRAMA</strong>:</p><p>JUEVES 11 DE MAYO (&Uacute;NICO ENCUENTRO)</p><p>-8.45: Acreditaci&oacute;n y presentaci&oacute;n de formularios</p><p>-9.00: Inicio</p><p>-14.30: Fin</p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo y presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso el d&iacute;a 11/05&nbsp;a las 8.45hs.</p><p>La inscripci&oacute;n finaliza el <strong>10&nbsp;DE MAYO a las 13 hs</strong> o una vez cubierto el cupo previsto para la actividad.</p><p>(Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/8e3cd40b34250067f2eae09454a6898fa1f2a0b5.pdf" target="_blank">CRONOGRAMA Y CONTENIDOS AQU&Iacute;</a></strong></p><h4 style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></h4><h4 style="text-align: center;"><strong>&nbsp;</strong></h4>', 'presencial', NULL, 1),
