(260, NULL, 'Destinatarios: Agentes de la administración pública provincial interesados en investigar y participar de la convocatoria de investigación 2017, conformados en grupos jurisdiccionales o interjurisdiccionales.', '<p><strong>FUNDAMENTACI&Oacute;N:</strong></p><p>El taller est&aacute; dise&ntilde;ado para orientar sobre la construcci&oacute;n de la idea proyecto&nbsp; y la planificaci&oacute;n de la investigaci&oacute;n a los empleados p&uacute;blicos interesados en desarrollar un proceso de investigaci&oacute;n que genere conocimientos aplicables a la gesti&oacute;n p&uacute;blica.</p><p>Se espera que a partir del mismo se presenten proyectos de investigaci&oacute;n que se enmarquen en la convocatoria de la Direcci&oacute;n de Investigaci&oacute;n 2017, Resoluci&oacute;n IPAP Chaco N&deg; 36/17, cuya tem&aacute;tica general es la atenci&oacute;n al ciudadano. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>Ver <strong>programa completo</strong> (FICHA T&Eacute;CNICA) del taller&nbsp;<a href="../../../uploads/publicacion/9da1cc8b1a82e92c5e9b88dba9ca1e75a154703e.pdf" target="_blank"><strong>AQU&Iacute;</strong></a></p><p>CHARLAS INFORMATIVAS: &nbsp;Martes 23 de mayo a las 8 hs. y a las 17 hs.&nbsp;</p><p><strong>Para participar lea atentamente los siguientes puntos: &nbsp; &nbsp; &nbsp;&nbsp;</strong></p><p>- El sistema s&oacute;lo le permitir&aacute; pre-inscreibirse si cumplimenta los pasos detallados en este enlace: <a href="../../../uploads/publicacion/bc83c66b6047f776c7ba091bf2e109e661256c51.pdf"><strong>Procedimiento de Inscripci&oacute;n al Taller de Investigaci&oacute;n</strong></a></p><p><strong>- </strong>Una vez que se han cumplimentado los pasos indicados en punto anterior ingresar: <a href="../../../alumno/cursos/todos"><strong>Pre-inscripci&oacute;n</strong></a></p><p>&nbsp;</p><p><strong>Consultas:&nbsp;</strong></p><p><strong>ipap.investigacion@gmail.com </strong>para m&aacute;s informaci&oacute;n</p>', 'semipresencial', NULL, 1),
(261, NULL, 'CAPACITADORA: Lic.  Andrea Sandobal - Directora General de Modernización del Estado – Secretaría General de Gobierno y Coordinación.', '<p>Destinado especialmente a empleados del Estado Provincial, ingresados en los &uacute;ltimos a&ntilde;os a la planta Permanente de la Administraci&oacute;n P&uacute;blica y todo agente interesado en la tem&aacute;tica.</p><p style="text-align: center;">&nbsp;<strong>Tendr&aacute;n prioridad en la inscripci&oacute;n aquellos agentes que residan en el interior de la provincia.</strong></p><p style="text-align: center;"><strong>&nbsp;ESTA ACTIVIDAD SE DESARROLLAR&Aacute; INTEGRAMENTE EN LA MODALIDAD VIRTUAL</strong></p><p>Para participar los interesados deber&aacute;n <strong>pre-inscribirse</strong> a trav&eacute;s de la p&aacute;gina <strong>ipap.chaco.gov.ar. </strong>El correo que use para pre-inscribirse ser&aacute; utilizado para enviarle el usuario y contrase&ntilde;a para ingresar al curso en la plataforma virtual, por tal motivo, para los cursos de modalidad virtual, es indispensable que el participante disponga de una <strong>CUENTA DE CORREO ELECTR&Oacute;NICO PERSONAL, V&Aacute;LIDA Y DE USO FRECUENTE. </strong>La inscripci&oacute;n <strong>finaliza el 26 de mayo</strong> a las 20hs.(No se requerir&aacute; el formulario de inscripci&oacute;n impreso)</p><h2 style="text-align: center;"><a href="../../../uploads/publicacion/1016c07cfa95d29ddabcab741189c57834b9b7b2.pdf" target="_blank">CRONOGRAMA Y CONTENIDOS AQU&Iacute;</a></h2><h2 style="text-align: center;"><a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></h2><p>&nbsp;</p><p>&nbsp;</p>', 'elearning', NULL, 1),
(262, NULL, 'Capacitadoras: Prof. Natalia Péres y Prof. Alejandra Maidana.', NULL, 'presencial', NULL, 1),
(263, NULL, 'A cargo de M. Brugnoli.', '<p>De acuerdo con el Estatuto del Empleado p&uacute;blico, lograr la profesionalizaci&oacute;n del empleo p&uacute;blico requiere que los recursos humanos conozcan el marco jur&iacute;dico que organiza y rige su puesto de trabajo, as&iacute; como los deberes y responsabilidades estatutarios. Se observa entonces, la necesidad de destinar al personal del Estado provincial, ingresado en el corto plazo, un espacio de formaci&oacute;n inicial inductiva sobre la responsabilidad laboral y sus derechos, deberes y obligaciones, establecidos en la normativa vigente para el empleado p&uacute;blico de la Provincia del Chaco.</p><p><strong>DESTINATARIOS</strong>:&nbsp;Empleados del Estado Provincial comprendidos en la ley 2017, ingresados en el corto plazo a la planta Permanente o Transitoria&nbsp;<strong><em>(Empresas del Estado, Vialidad, Becarios y Pasantes no encuadran en la ley mencionada anteriormente).</em></strong></p><p><strong>CRONOGRAMA</strong>:</p><p>MARTES 6 DE JUNIO (&Uacute;NICO ENCUENTRO)</p><p>-7.45: Acreditaci&oacute;n</p><p>-8.00: Inicio</p><p>-13.00: Fin</p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo&nbsp;<span lang="EN-GB">y presentar <strong>a la brevedad</strong> el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.</span></p><p>La inscripci&oacute;n finaliza el&nbsp;<strong>02 DE JUNIO&nbsp;a las&nbsp;20 hs</strong>&nbsp;o una vez cubierto el cupo previsto para la actividad.</p><p>(Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><a href="../../uploads/publicacion/6aeb9dd844268d13f817a551a1af445887b92793.pdf" target="_blank"><strong>CRONOGRAMA Y CONTENIDOS AQU&Iacute;</strong></a></p><h4 style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></h4><p>&nbsp;</p><p>&nbsp;</p>', 'presencial', NULL, 1),
(264, NULL, 'Entrenar a los funcionarios en competencias que les permitan generar acciones de liderazgo y gestión de equipos eficientes.', NULL, 'presencial', NULL, 1),
(265, NULL, 'Perfil específico de los destinatarios: personal que tengan contacto directo de atención al público o cuya función implique transmitir información, asesoramiento, contención u orientación al ciudadano o que tenga funciones operativas específicas en los servicios esenciales, críticos y de emergencia.', '<p>Dirigido al personal de diferentes Organismos de la Administraci&oacute;n P&uacute;blica, que tengan contacto directo de atenci&oacute;n al p&uacute;blico o cuya funci&oacute;n implique transmitir&nbsp; informaci&oacute;n, asesoramiento, contenci&oacute;n u orientaci&oacute;n al ciudadano.</p><p><strong>Tendr&aacute;n prioridad en la inscripci&oacute;n el personal con funciones operativas espec&iacute;ficas en los servicios esenciales,&nbsp; cr&iacute;ticos y de emergencia de los siguientes organismos y oficinas de:</strong></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Polic&iacute;a de la provincia del Chaco</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Desarrollo Social</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Salud P&uacute;blica</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Oficinas de atenci&oacute;n al p&uacute;blico de las jurisdicciones&nbsp;</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mesas de entradas de las jurisdicciones</p><p><strong>FECHA INICIO: Jueves 1&ordm; de&nbsp;Junio de 8.30 a 12.30 y de 14.30 a 17.30 hs</strong></p><p><strong>FINALIZA: Viernes 2&nbsp;de&nbsp;Junio de 9 a 12 hs</strong></p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo&nbsp;<span lang="EN-GB">y presentar&nbsp;<strong>a la brevedad</strong>&nbsp;el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.</span></p><p>La inscripci&oacute;n finaliza el <strong>31 de mayo </strong>a las <strong>13 hs</strong> o <strong>una vez cubierto el cupo previsto</strong> para la actividad. (Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a></strong></p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/bbaeefc9b8849cdb03e837dce2c68aa3659dd67d.pdf" target="_blank">CRONOGRAMA Y CONTENIDOS AQU&Iacute;</a></strong></p><h4 style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></h4>', 'presencial', NULL, 1),
