(267, NULL, 'A cargo de la Dra. Carola Centanaro- Directora de Sumarios de Casa de Gobierno – Asesoría General de Gobierno y de la Dra. Claudia Geraldi- Directora a cargo de sumarios docentes.', '<p><strong>&nbsp;&nbsp;&nbsp; </strong><strong>DESTINATARIOS:</strong></p><ul><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jefes de Departamentos</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Director de Recursos Humanos de las diferentes jurisdicciones</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Director&nbsp;&nbsp; General&nbsp; de Recursos Humanos</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores &nbsp;de las jurisdicciones</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores Generales</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Directores de Secretar&iacute;a General de las jurisdicciones</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Asesores legales de las jurisdicciones</li></ul><p>&nbsp;</p><p><strong>CRONOGRAMA</strong></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Jueves 22 de junio -&nbsp; 8.45 hs-Acreditaci&oacute;n y presentaci&oacute;n de formularios</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;9 a 12 hs <em>y de 14 a 17hs - Actividad te&oacute;rico pr&aacute;ctica</em></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Viernes 23 de junio -&nbsp; Horario: 9 a 12 hs - <em>Actividad te&oacute;rico pr&aacute;ctica + Trabajo Pr&aacute;ctico</em></p><p><strong><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mi&eacute;rcoles 28 de junio a las 20hs: env&iacute;o del TP a &nbsp;</em></strong><a href="mailto:ipapchaco@gmail.com"><strong><em>ipapchaco@gmail.com</em></strong></a></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Martes 4 de julio: 9 a 12hs - Defensa de Trabajo Pr&aacute;ctico+ Cierre de Evaluaci&oacute;n&nbsp;</p><p>&nbsp;</p><p><strong>SEDE:</strong> SAL&Oacute;N CHACO &ndash; UNIDAD REGIONAL CENTRO (SAN MART&Iacute;N 1198) &ndash; <strong>Hotel Atrium Gualok (Localidad Presidencia Roque S&aacute;enz Pe&ntilde;a)</strong></p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>IMPORTANTE</strong></p><p><strong>Los participantes deben <span style="text-decoration: underline;">efectuar la lectura previa a la capacitaci&oacute;n</span> de los art&iacute;culos </strong><strong>&nbsp;21 y 22 y de la Ley N&ordm; 2017 Estatuto para el Personal de la Administraci&oacute;n P&uacute;blica Provincial y el R&eacute;gimen Disciplinario, anexo de dicha ley y <span style="text-decoration: underline;">asistir a los encuentros con el material correspondiente.</span></strong></p><p>&nbsp;</p><p style="text-align: center;"><strong>INSCRIPCI&Oacute;N</strong>:</p><p>Para participar deber&aacute; <strong>pre-inscribirse</strong> en nuestra web <strong>ipap.chaco.gov.ar</strong> y el d&iacute;a de inicio del curso deber&aacute; presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso. La <strong>inscripci&oacute;n finaliza el lunes 19/06 a las 20 hs </strong>o <strong>una vez cubierto el cupo previsto</strong> para la actividad.</p><p>&nbsp;</p><p style="text-align: center;"><strong>&nbsp;<a href="../../../uploads/publicacion/e800f27130314aba4457ef8dec005ccb44edb4bb.pdf" target="_blank">CRONOGRAMA Y CONTENIDOS AQU&Iacute;</a></strong></p><p style="text-align: center;">&nbsp;</p><p style="text-align: center;"><strong><a href="../../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></p>', 'presencial', NULL, 0),
(268, NULL, 'A cargo de la Lic. María Soledad Brugnoli.', '<p>De acuerdo con el Estatuto del Empleado p&uacute;blico, lograr la profesionalizaci&oacute;n del empleo p&uacute;blico requiere que los recursos humanos conozcan el marco jur&iacute;dico que organiza y rige su puesto de trabajo, as&iacute; como los deberes y responsabilidades estatutarios. Se observa entonces, la necesidad de destinar al personal del Estado provincial, ingresado en el corto plazo, un espacio de formaci&oacute;n inicial inductiva sobre la responsabilidad laboral y sus derechos, deberes y obligaciones, establecidos en la normativa vigente para el empleado p&uacute;blico de la Provincia del Chaco.</p><p><strong>DESTINATARIOS</strong>:&nbsp;Empleados del Estado Provincial comprendidos en la ley 2017, ingresados en el corto plazo a la planta Permanente o Transitoria.</p><p><strong>CRONOGRAMA y LUGAR:&nbsp;</strong></p><p>JUEVES 15 DE JUNIO (&Uacute;NICO ENCUENTRO) -&nbsp;<strong>LUGAR: </strong><strong>SAL&Oacute;N CHACO &ndash; Hotel Atrium Gualok </strong>&nbsp;(Localidad Presidencia Roque S&aacute;enz Pe&ntilde;a)</p><p>-8.45: Acreditaci&oacute;n y presentaci&oacute;n de formularios</p><p>-9.00: Inicio</p><p>-14.30: Fin</p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo y presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso el d&iacute;a 15/06&nbsp;a las 8.45hs.</p><p>La inscripci&oacute;n finaliza el&nbsp;<strong>14 DE JUNIO a las 13 hs</strong>&nbsp;o una vez cubierto el cupo previsto para la actividad.</p><p>(Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><strong><a href="../../uploads/publicacion/4d50f7fba68d3a6595d26316d9e1e9ee41ab7af0.pdf" target="_blank">CRONOGRAMA Y CONTENIDOS AQU&Iacute;</a></strong></p><p style="text-align: center;"><strong><a href="../../alumno/cursos/todos" target="_blank">PRE INSCRIPCI&Oacute;N AQU&Iacute;</a></strong></p>', 'presencial', NULL, 1),
(269, NULL, 'A cargo de la Lic. María Soledad Brugnoli.', '<p>De acuerdo con el Estatuto del Empleado p&uacute;blico, lograr la profesionalizaci&oacute;n del empleo p&uacute;blico requiere que los recursos humanos conozcan el marco jur&iacute;dico que organiza y rige su puesto de trabajo, as&iacute; como los deberes y responsabilidades estatutarios. Se observa entonces, la necesidad de destinar al personal del Estado provincial, ingresado en el corto plazo, un espacio de formaci&oacute;n inicial inductiva sobre la responsabilidad laboral y sus derechos, deberes y obligaciones, establecidos en la normativa vigente para el empleado p&uacute;blico de la Provincia del Chaco.</p><p><strong>DESTINATARIOS</strong>:&nbsp;Empleados del Estado Provincial comprendidos en la ley 2017, ingresados en el corto plazo a la planta Permanente o Transitoria.</p><p><strong>CRONOGRAMA</strong>:</p><p>MI&Eacute;RCOLES 21&nbsp;DE JUNIO (&Uacute;NICO ENCUENTRO)</p><p>-7.45: Acreditaci&oacute;n</p><p>-8.00: Inicio</p><p>-13.00: Fin</p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo&nbsp;<span lang="EN-GB">y presentar&nbsp;<strong>a la brevedad</strong>&nbsp;el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.</span></p><p>La inscripci&oacute;n finaliza el&nbsp;<strong>19 DE JUNIO&nbsp;a las 12 hs</strong>&nbsp;o una vez cubierto el cupo previsto para la actividad.</p><p>(Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><a href="../../uploads/publicacion/3306a9b58e22