(270, NULL, 'A cargo de Mauricio Brugnoli.', '<p>De acuerdo con el Estatuto del Empleado p&uacute;blico, lograr la profesionalizaci&oacute;n del empleo p&uacute;blico requiere que los recursos humanos conozcan el marco jur&iacute;dico que organiza y rige su puesto de trabajo, as&iacute; como los deberes y responsabilidades estatutarios. Se observa entonces, la necesidad de destinar al personal del Estado provincial, ingresado en el corto plazo, un espacio de formaci&oacute;n inicial inductiva sobre la responsabilidad laboral y sus derechos, deberes y obligaciones, establecidos en la normativa vigente para el empleado p&uacute;blico de la Provincia del Chaco.</p><p><strong>DESTINATARIOS</strong>:&nbsp;Empleados del Estado Provincial comprendidos en la ley 2017, ingresados en el corto plazo a la planta Permanente o Transitoria.</p><p><strong>CRONOGRAMA</strong>:</p><p>MARTES 04 DE JULIO&nbsp;(&Uacute;NICO ENCUENTRO)</p><p>-8.30: Acreditaci&oacute;n y presentaci&oacute;n de formularios</p><p>-9.00: Inicio</p><p>-14.30: Fin</p><p><strong>IMPORTANTE</strong>:</p><p>Para&nbsp;<strong>participar</strong>&nbsp;deber&aacute; ingresar en el link "Pre-inscripci&oacute;n aqu&iacute;" que se encuentra m&aacute;s abajo y presentar el formulario de inscripci&oacute;n impreso, con la autorizaci&oacute;n del jefe para asistir al curso el d&iacute;a 04/07 a las 8.30hs.</p><p>La inscripci&oacute;n finaliza el <strong>3 DE JULIO&nbsp;a las 13 hs</strong>&nbsp;o una vez cubierto el cupo previsto para la actividad.</p><p>(Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente)</p><p><strong>Si tiene dificultades para inscribirse, no dude en comunicarse con IPAP de 7 a 20hs llamando al 0362-4453723 o a trav&eacute;s del email&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>.</strong></p><p style="text-align: center;"><a href="../../../uploads/publicacion/4976e934d827d543b3c41a04347a40bf227dcb3